      super(props);
  }
  render () {
    return (
      <React.Fragment>
      	<mycontextOne.Consumer>
      	{
      		obj=><div>{obj}</div>
  		}
        </mycontextOne.Consumer>
       // <div>CCCCCC</div>
      </React.Fragment>
      );
  }
}

export default C;
